column3:
Vladimir Afanasyevich Lyakhov (Russian: Влади́мир Афана́сьевич Ля́хов; born July 20, 1941) is a former Soviet cosmonaut. He was selected as cosmonaut on May 5, 1967, and retired on September 7, 1994. Lyakhov was the Commander on Soyuz 32, Soyuz T-9 and Soyuz TM-6, and spent 333 days, 7 hours, 47 minutes in space. He is married and has two children. He was awarded: 
* Twice Hero of the Soviet Union; 
* Pilot-Cosmonaut of the USSR; 
* Two Orders of Lenin; 
* Order of the October Revolution; 
* Medal "For Merit in Space Exploration" (Russian Federation); 
* Order of Sukhbaatar (Mongolia); 
* Order "The Sun of Liberty" (Afghanistan); 
* Order of Merit 3rd class (Ukraine).
